<div id="COVID-2019_UA_15916" align=center x:publishsource="Excel">

<h1 style='color:black;font-family:Calibri;font-size:14.0pt;font-weight:800;
font-style:normal'>Comparison of COVID-2019 in Ukraine and the other countries</h1>

<table border=0 cellpadding=0 cellspacing=0 width=1024 style='border-collapse:
 collapse;table-layout:fixed;width:768pt'>
 <col width=64 span=16 style='width:48pt'>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl1515916 colspan=16 width=1024 style='height:15.0pt;
  width:768pt'>Epidemy in China Hubei (CHHU) and South Korea is close to end
  and can be used now as examples of COVID-2019 Epidemy to comparison with Ukrainian data.</td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl1515916 colspan=14 style='height:15.0pt'>As can be
  seen, total infection speed during COVID-2019 can be expressed as sum of a few infection waves, peaks of which
  shifted in time</td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl1515916 colspan=15 style='height:15.0pt'>from the first
  day of Epydemy. Chineese and Korean experience shows how important is to wait for the end of the 1st infection
  wave before changing </td>
  <td class=xl1515916></td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl1515916 colspan=7 style='height:15.0pt'> quarantine limitations to avoid 2nd and
  other infectrion peaks.</td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl1515916 colspan=14 style='height:15.0pt'>It can be
  seen, that the best case for Ukraine was at least to follow Korean scenario
  and in the perfect case complete on its 1st infection wave.</td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl1515916 colspan=15 style='height:15.0pt'>As Ukraine is
  in Europian Region, it is also important to compare its infection data with
  main Europian countries, that are on peak or close to the end </td>
  <td class=xl1515916></td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl1515916 colspan=8 style='height:15.0pt'>of the
  COVID-2019 epidemy to understand possible COVID-2019 scenario.</td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl6415916 colspan=11 style='height:15.0pt'>Important
  conclusion of this comparison is that COVID-2019 demonstrates multiwave
  (3-10) passing epidemy.</td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl6415916 colspan=7 style='height:15.0pt'>Typical shift
  betwen infection waves is about 5-16 days or even less.</td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
  <td class=xl1515916></td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 class=xl6415916 colspan=15 style='height:15.0pt'>Below are the results of comparison Ukrainian data with China
  (Hubei), S.Korea, Austria, Norway, Germany, France, Italy, Spain, Denmark and
  Sweden.</td>
  <td class=xl1515916></td>
 </tr>
